                            Description = "<p>In de Inetum-Realdolmen Project Factory (PF) ontwikkelen developers van Inetum Realdolmen software in opdracht van een klant. Al het development gebeurd in house, met de tooling van Inetum-Realdolmen. De klant krijgt dus zijn deliverable op&nbsp;bepaalde tijdstippen en hoeft geen volledig development team te hebben.&nbsp;</p><p>Om onze PF te ondersteunen, hebben enkele collega&rsquo;s een bibliotheek opgericht. Hier&nbsp;kunnen onze developers boeken uitlenen. Momenteel wordt het uitleen-gedrag&nbsp;bijgehouden op een blad papier. Alsook aanvragen om nieuwe boeken aan te kopen&nbsp;worden op papier bijgehouden. Dit is een bewuste keuze. Als we het uitleen-gedrag&nbsp;digitaliseren op basis van bestaande tools (Google Drive, SharePoint...) zorgt dit voor&nbsp;extra overhead, dit be&iuml;nvloedt de toegankelijkheid van de bibliotheek.</p>",
                            InternShipId = 3,
                            IsDeleted = false,
                            KnowledgeToDevelop = "<p><u>Niet technisch</u>&nbsp;</p>\r\n<ul>\r\n	<li>Werken in de SCRUM methodologie</li>\r\n	<li>Samenwerken in teamverband</li>\r\n	<li>Bespreken/inschatten en opleveren van deliverables in afgesproken tijdspanne</li>\r\n	<li>Communiceren met klanten/eindgebruikers</li>\r\n	<li>Verantwoordelijkheid, ownership kunnen nemen over de opdracht</li>\r\n	<li>Zelfstandig kunnen werken</li>\r\n</ul>\r\n<p><u>Technisch</u></p>\r\n<ul>\r\n	<li>Angular</li>\r\n	<li>Ionic / NativeScript / &hellip; (te bepalen in samenspraak)</li>\r\n	<li>REST principes</li>\r\n	<li>AngularFire / Firebase (te bepalen in samenspraak)</li>\r\n	<li>Continuous Integration / Continuous Deployment&nbsp;</li>\r\n</ul>",
                            LanguageId = 1,
                            LastModifiedDate = new DateTime(2023, 6, 5, 11, 9, 56, 201, DateTimeKind.Utc).AddTicks(3298),
                            NeededKnowledge = "<p><u>Niet technisch</u></p>\r\n<ul>\r\n	<li>Verantwoordelijkheid</li>\r\n	<li>Zelfstandig</li>\r\n	<li>Probleemoplossend denken</li>\r\n	<li>Assertief</li>\r\n	<li>Positief ingesteld</li>\r\n</ul>\r\n<p><u>Technisch</u></p>\r\n<ul>\r\n	<li>Basiskennis Angular</li>\r\n	<li>Kennis van REST principes</li>\r\n</ul>\r\n<p><u>Bonus</u></p>\r\n<ul>\r\n	<li>Ervaring met een Angular Mobile framework</li>\r\n	<li>Ervaring Firebase en/of AngularFire</li>\r\n	<li>Ervaring met/kennis van Continious Itegration / Continuous Deployment</li>\r\n</ul>",
                            TitleContent = " R-Library"
                        },
                        new
                        {
                            Id = 8,
                            Comment = "<p>Il est requis de se rendre au bureau une journee par semaine.</p>",
                            CreatedDate = new DateTime(2023, 6, 5, 11, 9, 56, 201, DateTimeKind.Utc).AddTicks(3300),
                            Description = "<p>Dans l&#39;Inetum-Realdolmen Project Factory (PF), les d&eacute;veloppeurs d&#39;Inetum-Realdolmen d&eacute;veloppent des logiciels sur demande d&#39;un client. Tout le d&eacute;veloppement se fait en interne, avec les outils d&#39;Inetum-Realdolmen. Ainsi, le client re&ccedil;oit ses livrables &agrave; des moments pr&eacute;cis et n&#39;a pas besoin d&#39;avoir une &eacute;quipe de d&eacute;veloppement compl&egrave;te.&nbsp;<br />\r\nPour soutenir notre PF, certains coll&egrave;gues ont cr&eacute;&eacute; une biblioth&egrave;que. Nos d&eacute;veloppeurs peuvent y emprunter des livres. Actuellement, les emprunts sont enregistr&eacute;s sur une feuille de papier. De m&ecirc;me, les demandes d&#39;achat de nouveaux livres sont consign&eacute;es sur papier. C&#39;est un choix d&eacute;lib&eacute;r&eacute;. Si nous num&eacute;risons les emprunts &agrave; l&#39;aide </p>",
                            InternShipId = 3,
